import XCTest
@testable import DescargaMasivaSATKit

class StubDownloadSharedSession: SharedSession {
    enum Statuses: String {
        case invalidCert
        case packageNotFound
        case completed
        case maxPermittedSize
    }
    
    let xmlResponses: [Statuses: String] = [
        .invalidCert: "<s:Envelope xmlns:s=\"http://schemas.xmlsoap.org/soap/envelope/\"><s:Header><h:respuesta CodEstatus=\"305\" Mensaje=\"Certificado Inválido\" xmlns:h=\"http://DescargaMasivaTerceros.sat.gob.mx\" xmlns=\"http://DescargaMasivaTerceros.sat.gob.mx\" xmlns:xsd=\"http://www.w3.org/2001/XMLSchema\" xmlns:xsi=\"http://www.w3.org/2001/XMLSchema-instance\"/></s:Header><s:Body xmlns:xsi=\"http://www.w3.org/2001/XMLSchema-instance\" xmlns:xsd=\"http://www.w3.org/2001/XMLSchema\"><RespuestaDescargaMasivaTercerosSalida xmlns=\"http://DescargaMasivaTerceros.sat.gob.mx\"><Paquete/></RespuestaDescargaMasivaTercerosSalida></s:Body></s:Envelope>",
        .packageNotFound: "<s:Envelope xmlns:s=\"http://schemas.xmlsoap.org/soap/envelope/\"><s:Header><h:respuesta CodEstatus=\"5004\" Mensaje=\"No se encontro la informacion\" xmlns:h=\"http://DescargaMasivaTerceros.sat.gob.mx\" xmlns=\"http://DescargaMasivaTerceros.sat.gob.mx\" xmlns:xsd=\"http://www.w3.org/2001/XMLSchema\" xmlns:xsi=\"http://www.w3.org/2001/XMLSchema-instance\"/></s:Header><s:Body xmlns:xsi=\"http://www.w3.org/2001/XMLSchema-instance\" xmlns:xsd=\"http://www.w3.org/2001/XMLSchema\"><RespuestaDescargaMasivaTercerosSalida xmlns=\"http://DescargaMasivaTerceros.sat.gob.mx\"><Paquete/></RespuestaDescargaMasivaTercerosSalida></s:Body></s:Envelope>",
        .completed: "<s:Envelope xmlns:s=\"http://schemas.xmlsoap.org/soap/envelope/\"><s:Header><h:respuesta CodEstatus=\"5000\" Mensaje=\"Solicitud Aceptada\" xmlns:h=\"http://DescargaMasivaTerceros.sat.gob.mx\" xmlns=\"http://DescargaMasivaTerceros.sat.gob.mx\" xmlns:xsd=\"http://www.w3.org/2001/XMLSchema\" xmlns:xsi=\"http://www.w3.org/2001/XMLSchema-instance\"/></s:Header><s:Body xmlns:xsi=\"http://www.w3.org/2001/XMLSchema-instance\" xmlns:xsd=\"http://www.w3.org/2001/XMLSchema\"><RespuestaDescargaMasivaTercerosSalida xmlns=\"http://DescargaMasivaTerceros.sat.gob.mx\"><Paquete></Paquete></RespuestaDescargaMasivaTercerosSalida></s:Body></s:Envelope>",
        .maxPermittedSize: "<s:Envelope xmlns:s=\"http://schemas.xmlsoap.org/soap/envelope/\"><s:Header><h:respuesta CodEstatus=\"5008\" Mensaje=\"Maximo de descargas permitidas.\" xmlns:h=\"http://DescargaMasivaTerceros.sat.gob.mx\" xmlns=\"http://DescargaMasivaTerceros.sat.gob.mx\" xmlns:xsd=\"http://www.w3.org/2001/XMLSchema\" xmlns:xsi=\"http://www.w3.org/2001/XMLSchema-instance\"/></s:Header><s:Body xmlns:xsi=\"http://www.w3.org/2001/XMLSchema-instance\" xmlns:xsd=\"http://www.w3.org/2001/XMLSchema\"><RespuestaDescargaMasivaTercerosSalida xmlns=\"http://DescargaMasivaTerceros.sat.gob.mx\"><Paquete/></RespuestaDescargaMasivaTercerosSalida></s:Body></s:Envelope>"
    ]
    
    var response: Statuses = .invalidCert
    var statusCode = 200
    func data(for: URLRequest) async throws -> (Data, URLResponse) {
        let xml = xmlResponses[response]!
        let data = xml.data(using: .utf8)!
        let urlResponse = HTTPURLResponse(url: URL(string:"https://cfdidescargamasiva.clouda.sat.gob.mx/DescargaMasivaService.svc")!, statusCode: statusCode, httpVersion: "1.1",  headerFields: ["Cache-Control": "private","Content-Encoding": "gzip", "Content-Type": "text/xml; charset=utf-8", "Date": "Thu, 11 Sep 2025 05:29:59 GMT", "Server": "Microsoft-IIS/10.0", "Strict-Transport-Security": "max-age=31536000; includeSubDomains", "Vary": "Accept-Encoding", "x-aspnet-version": "4.0.30319", "x-content-type-options": "nosniff", "x-frame-options": "SAMEORIGIN", "x-xss-protection": "1"])!
        return (data, urlResponse as URLResponse)
    }
}

final class DownloadTest: XCTestCase {
    
    let sharedSession = StubDownloadSharedSession()
    
    override func setUpWithError() throws {
        if let certUrl = Bundle(for: DownloadTest.self).url(forResource: "certificate", withExtension: "cer"), let keyURL = Bundle(for: DownloadTest.self).url(forResource: "privkey", withExtension: "key") {
            let certData = try Data(contentsOf: certUrl)
            let keyData = try Data(contentsOf: keyURL)
            try AuthenticationManager.shared.add(certData: certData, keyData: keyData)
        }
    }
    
    func testInit() {
        let download = DownloadEndpoint(packageId: "E7092BEB-1EAC-4C32-B4FE-DDA5FE95A712_01")
        XCTAssertNotNil(download)
    }
    
    func testInvalidCertRequest() async throws {
        sharedSession.response = .invalidCert
        let download = DownloadEndpoint(packageId: "E7092BEB-1EAC-4C32-B4FE-DDA5FE95A712_01")
        let result = try await download.request(sharedSession)
        if let data = result.data(using: .utf8) {
            let obj = try JSONDecoder().decode(DownloadResponse.self, from: data)
            XCTAssertNotNil(obj.result)
            XCTAssertEqual(obj.result.CodEstatus, 305)
            XCTAssertEqual(obj.result.Mensaje, "Certificado Inválido")
        }
    }
    
    func testPublicRequest() async throws {
        let download = DownloadEndpoint(packageId: "E7092BEB-1EAC-4C32-B4FE-DDA5FE95A712_01")
        let result = try await download.request()
        if let data = result.data(using: .utf8) {
            let obj = try JSONDecoder().decode(DownloadResponse.self, from: data)
            XCTAssertNotNil(obj.result)
            XCTAssertEqual(obj.result.CodEstatus, 305)
            XCTAssertEqual(obj.result.Mensaje, "Certificado Inválido")
        }
    }
    
    func testPackageNotFoundRequest() async throws {
        sharedSession.response = .packageNotFound
        let download = DownloadEndpoint(packageId: "E7092BEB-1EAC-4C32-B4FE-DDA5FE95A712_01")
        let result = try await download.request(sharedSession)
        if let data = result.data(using: .utf8) {
            let obj = try JSONDecoder().decode(DownloadResponse.self, from: data)
            XCTAssertNotNil(obj.result)
            XCTAssertEqual(obj.result.CodEstatus, 5004)
            XCTAssertEqual(obj.result.Mensaje, "No se encontro la informacion")
            XCTAssertNil(obj.contents)
        }
    }
    
    func testCompletedRequest() async throws {
        sharedSession.response = .completed
        let download = DownloadEndpoint(packageId: "E7092BEB-1EAC-4C32-B4FE-DDA5FE95A712_01")
        let result = try await download.request(sharedSession)
        if let data = result.data(using: .utf8) {
            let obj = try JSONDecoder().decode(DownloadResponse.self, from: data)
            XCTAssertNotNil(obj.result)
            XCTAssertEqual(obj.result.CodEstatus, 5000)
            XCTAssertEqual(obj.result.Mensaje, "Solicitud Aceptada")
            XCTAssertNotNil(obj.contents)
        }
    }
    
    func testMaxPermittedSize() async throws {
        sharedSession.response = .maxPermittedSize
        let download = DownloadEndpoint(packageId: "E7092BEB-1EAC-4C32-B4FE-DDA5FE95A712_01")
        let result = try await download.request(sharedSession)
        if let data = result.data(using: .utf8) {
            let obj = try JSONDecoder().decode(DownloadResponse.self, from: data)
            XCTAssertNotNil(obj.result)
            XCTAssertEqual(obj.result.CodEstatus, 5008)
            XCTAssertEqual(obj.result.Mensaje, "Maximo de descargas permitidas.")
            XCTAssertNil(obj.contents)
        }
    }
    
    func test404Request() async {
        sharedSession.statusCode = 404
        let download = DownloadEndpoint(packageId: "E7092BEB-1EAC-4C32-B4FE-DDA5FE95A712_01")
        await XCTAssertThrowsErrorAsync(try await download.request(sharedSession), DownloadEndpointResultError.httpError(statusCode: 404)) 
    }
    
}
